elements.expression:
filters
| essql 
  query="SELECT 
airport as Airport, 
message_type \"Message Type\",
flight_year as Year, 
SUM(inbound_passenger_count) as Inbound,
SUM(outbound_passenger_count) as Outbound, 
SUM(passenger_count) as Total

FROM \"message-flight-idx\" 
GROUP BY airport,flight_year,  message_type
ORDER BY flight_year desc,   airport asc,message_type asc
"
| mapColumn "Inbound" fn={if {getCell "Inbound" | eq null} then=0 else={getCell "Inbound"}}
| mapColumn "Outbound" fn={if {getCell "Outbound" | eq null} then=0 else={getCell "Outbound"}}
| table showHeader=true 
  font={font family="'Open Sans', Helvetica, Arial, sans-serif" size=12 align="left" color="#000000" weight="normal" underline=false italic=false}
| render 
  css=".canvasRenderEl{

}
.canvasDataTable__tbody>:nth-child(even) {
background-color:#e6f5ff;
}
.canvasDataTable__tbody>:nth-child(odd) {
background-color:#FFFFFF ;
}

.canvasDataTable__th {background-color: #1974D2; color: #FFFFFF; 
}" containerStyle={containerStyle border="1px solid #1974D2"}

